class Solution {
    func findPrimePairs(_ n: Int) -> [[Int]] {
        guard n >= 4 else {
            return []
        }

        func isPrime(_ number: Int) -> Bool {
            if number <= 1 {
                return false
            }
            for i in 2..<Int(Double(number).squareRoot())+1 {
                if number % i == 0 {
                    return false
                }
            }
            return true
        }

        var result: [[Int]] = []
        for i in 2...n/2 {
            if isPrime(i) && isPrime(n - i) {
                result.append([i, n - i])
            }
        }
        return result
    }
}
